import React from 'react';
import logo from './logo.svg';
import {BrowserRouter} from 'react-router-dom'
import './App.css';
import TopMenu from './components/home/topMenu'

function App() {
  return (
    <BrowserRouter>
       <div className="App">
      <header className="App-header">
          App in design
          <TopMenu/>
      </header>
    </div>
    </BrowserRouter>

  );
}

export default App;
